-- ----------------------------
-- View structure for view_hiddendanger
-- ----------------------------
DROP VIEW IF EXISTS `view_hiddendanger`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_hiddendanger` AS select `b`.`itemType` AS `itemType`,`b`.`violationContent` AS `violationContent`,`b`.`id` AS `id`,`b`.`projectId` AS `projectId`,`b`.`noticeTimeStamp` AS `noticeTimeStamp`,`b`.`uploadDate` AS `uploadDate`,`b`.`isRead` AS `isRead`,`b`.`isDelete` AS `isDelete`,`a`.`inspectPosition` AS `inspectPosition`,`tb_project`.`projectName` AS `projectName`,`tb_project`.`company` AS `company`,`a`.`state` AS `state`,`a`.`endDate` AS `endDate`,`a`.`inspectItemHead` AS `inspectItemHead`,`b`.`rectificationStatus` AS `rectificationStatus`,`a`.`inspectProcedure` AS `inspectProcedure`,`a`.`inspectUnit` AS `inspectUnit`,`a`.`rectificationDate` AS `rectificationDate`,`a`.`noticeNumber` AS `noticeNumber` from ((`tb_inspectaccept_notice` `a` join `tb_inspectaccept_violationitem` `b`) join `tb_project`) where ((`a`.`noticeTimeStamp` = `b`.`noticeTimeStamp`) and (`a`.`projectId` = `tb_project`.`id`));

-- ----------------------------
-- View structure for view_rectificationclose
-- ----------------------------
DROP VIEW IF EXISTS `view_rectificationclose`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_rectificationclose` AS select `a`.`id` AS `id`,`a`.`state` AS `state`,`b`.`projectName` AS `projectName`,`b`.`company` AS `company`,`a`.`projectId` AS `projectId`,`a`.`isRead` AS `isRead`,`a`.`isDelete` AS `isDelete`,`a`.`noticeTimeStamp` AS `noticeTimeStamp`,`a`.`rectificationDate` AS `rectificationDate`,`a`.`inspectPosition` AS `inspectPosition` from (`tb_inspectaccept_notice` `a` join `tb_project` `b`) where (`a`.`projectId` = `b`.`id`);

SET FOREIGN_KEY_CHECKS = 1;
