INSERT INTO `tb_inspectaccept_procedure` VALUES (9, '实名制工序', '1.地基基础工程（钻/冲孔灌注桩）', '桩顶砼浮浆标高符合设计要求', '混凝土结构工程', '标准工序', '1.9');
INSERT INTO `tb_inspectaccept_procedure` VALUES (10, '实名制工序', '1.地基基础工程（人工挖孔灌注桩）', '桩定位准确；桩孔长、扩大头尺寸及进入持力层深度、沉渣厚度符合设计要求。', '混凝土结构工程', '标准工序', '1.18');
INSERT INTO `tb_inspectaccept_procedure` VALUES (11, '实名制工序', '1.地基基础工程（人工挖孔灌注桩）', '桩身钢筋长度和钢筋顶标高符合设计要求', '混凝土结构工程', '标准工序', '1.11');
INSERT INTO `tb_inspectaccept_procedure` VALUES (12, '实名制工序', '1.地基基础工程（人工挖孔灌注桩）', '桩顶砼浮浆标高符合设计要求', '混凝土结构工程', '标准工序', '1.12');
INSERT INTO `tb_inspectaccept_procedure` VALUES (13, '实名制工序', '1.地基基础工程（地基与基础安全可靠）', '不得在桩基础检测不合格、基础验槽不合格的情况下进行后续主体结构施工，天然基础、强夯基础、换填基础必须保证地基承载力和密实度', '混凝土结构工程', '标准工序', '1.13');
INSERT INTO `tb_inspectaccept_procedure` VALUES (14, '实名制工序', '2.钢筋工程', '设计变更位置执行，是否按图施工。', '混凝土结构工程', '简化工序', '2.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (15, '实名制工序', '2.钢筋工程', '钢筋原材料和钢筋连接试件全部送检，送检结果全部合格', '混凝土结构工程', '简化工序', '2.2');
INSERT INTO `tb_inspectaccept_procedure` VALUES (16, '实名制工序', '2.钢筋工程', '钢筋的品种、级别、规格、数量符合设计要求，严禁使用瘦身钢筋、鱼鳞状严重锈蚀的钢筋', '混凝土结构工程', '简化工序', '2.3');
INSERT INTO `tb_inspectaccept_procedure` VALUES (17, '实名制工序', '2.钢筋工程', '受力主筋的钢筋接头的留设位置符合设计和规范要求；节点部位、加密区箍筋漏设', '混凝土结构工程', '简化工序', '2.4');
INSERT INTO `tb_inspectaccept_procedure` VALUES (19, '实名制工序', '2.钢筋工程', '悬挑结构构件钢筋规格、数量按图施工，上下部钢筋位置、锚固长度、方式正确。', '混凝土结构工程', '简化工序', '2.5');
INSERT INTO `tb_inspectaccept_procedure` VALUES (20, '实名制工序', '2.钢筋工程', '楼板面筋标高控制及钢筋保护层符合规范要求', '混凝土结构工程', '简化工序', '2.6');
INSERT INTO `tb_inspectaccept_procedure` VALUES (21, '实名制工序', '3.模板工程', '楼层墙柱定位、楼层标高复核（梁板模抄平验收）', '混凝土结构工程', '标准工序', '3.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (22, '实名制工序', '3.模板工程', '模板支撑体系稳固，支模架立杆间距、水平杆步距、顶端自由端长度、对拉螺杆间距及螺帽拧紧等符合施工方案要求。', '混凝土结构工程', '标准工序', '3.2');
INSERT INTO `tb_inspectaccept_procedure` VALUES (23, '实名制工序', '3.模板工程', '后浇带模板应单独支撑，且不得在后浇带封闭前拆除支撑或拆除后回顶。', '混凝土结构工程', '标准工序', '3.3');
INSERT INTO `tb_inspectaccept_procedure` VALUES (24, '实名制工序', '3.模板工程', '地下室顶板上设置的设备基础和未回填土前的行车运输通道位置，须在下层设回顶支撑。', '混凝土结构工程', '标准工序', '3.4');
INSERT INTO `tb_inspectaccept_procedure` VALUES (25, '实名制工序', '3.模板工程', '薄壁悬挑部位模板支撑须配3套，且不得过早拆模、超荷堆载。', '混凝土结构工程', '标准工序', '3.5');
INSERT INTO `tb_inspectaccept_procedure` VALUES (26, '实名制工序', '3.模板工程', '模板清扫口留设、垃圾清理干净、浇筑前模板淋水湿润；支模架与外架相连。', '混凝土结构工程', '标准工序', '3.6');
INSERT INTO `tb_inspectaccept_procedure` VALUES (27, '实名制工序', '3.模板工程', '外墙和电梯井剪力墙垂直度符合规范要求，楼板模板的标高，构件定位符合施工规范要求。', '混凝土结构工程', '标准工序', '3.7');
INSERT INTO `tb_inspectaccept_procedure` VALUES (28, '实名制工序', '3.模板工程', '坎台设置符合两防要求，存在拉铁丝或用木条支撑。', '混凝土结构工程', '标准工序', '3.8');
INSERT INTO `tb_inspectaccept_procedure` VALUES (29, '实名制工序', '5.混凝土工程', '混凝土标号核实（检查供应计划、随车料单、砼强度等级信息）。', '混凝土结构工程', '简化工序', '5.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (31, '实名制工序', '5.混凝土工程', '地下室后浇带不得擅自取消、改变位置；后浇带浇筑前施工缝凿毛清理符合要求，使用的砼配合比符合设计要求。基础后浇带不得在未完成顶板回填土且无有效降水措施的情况下封闭', '混凝土结构工程', '简化工序', '5.3');
INSERT INTO `tb_inspectaccept_procedure` VALUES (32, '实名制工序', '5.混凝土工程', '超过2个等级标号混凝土节点部位的防混浇措施落实。', '混凝土结构工程', '简化工序', '5.4');
INSERT INTO `tb_inspectaccept_procedure` VALUES (33, '实名制工序', '5.混凝土工程', '楼板厚度、标高、收面符合要求，混凝土凝结时间存在异常情况', '混凝土结构工程', '简化工序', '5.5');
INSERT INTO `tb_inspectaccept_procedure` VALUES (34, '实名制工序', '5.混凝土工程', '存在严重缺陷（混浇、开裂、砂化、强度不足、孔洞、露筋、蜂窝等）', '混凝土结构工程', '简化工序', '5.6');
INSERT INTO `tb_inspectaccept_procedure` VALUES (35, '实名制工序', '5.混凝土工程', '存在过早堆载、超载情况；模板过早拆除，悬挑构件或上部有高支模部位的楼板，不得在上层结构未施工完成的情况下拆除模板。', '混凝土结构工程', '简化工序', '5.7');
INSERT INTO `tb_inspectaccept_procedure` VALUES (36, '实名制工序', '6.防水工程', '基底处理（侧壁螺杆清理干净、渗漏和裂缝处理、基底缺陷及松散物处理、后浇带位置处理、基层处理毛糙等）。', '混凝土结构工程', '标准工序', '6.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (37, '实名制工序', '6.防水工程', '防水材料质量（品牌、品种、厚度、检测报告）', '混凝土结构工程', '标准工序', '6.2');
INSERT INTO `tb_inspectaccept_procedure` VALUES (38, '实名制工序', '6.防水工程', '反应型卷材品种（单/双面）、反应面方向正确', '混凝土结构工程', '标准工序', '6.4');
INSERT INTO `tb_inspectaccept_procedure` VALUES (39, '实名制工序', '6.防水工程', '卷材铺贴平整，搭接质量合格，无空鼓、皱褶或脱落，保护膜撕除', '混凝土结构工程', '标准工序', '6.5');
INSERT INTO `tb_inspectaccept_procedure` VALUES (40, '实名制工序', '6.防水工程', '地下室防渗漏：防水完整、砼浇筑振捣密实、后浇带清理干净；后续工序施工前对结构底板进行渗漏专项检查验收。', '混凝土结构工程', '标准工序', '6.6');
INSERT INTO `tb_inspectaccept_procedure` VALUES (41, '实名制工序', '6.防水工程', '厨卫、阳露台：管根、侧排、烟道口封堵等处理妥当；厨卫、阳露台、屋面必须做结构蓄水试验', '混凝土结构工程', '标准工序', '6.7');
INSERT INTO `tb_inspectaccept_procedure` VALUES (42, '实名制工序', '6.防水工程', '阴角根部柔性防水按要求上翻，上翻高度足够，同时收口符合设计要求。', '混凝土结构工程', '标准工序', '6.8');
INSERT INTO `tb_inspectaccept_procedure` VALUES (43, '实名制工序', '6.防水工程', '防水卷材按要求见证取样送检并检测合格', '混凝土结构工程', '标准工序', '6.3');
INSERT INTO `tb_inspectaccept_procedure` VALUES (44, '实名制工序', '7.砌体工程（砌块）', '严禁使用：不合格海砂、未熟透的石灰膏、过期水泥、过期砂浆、砂浆王或有害塑化剂等。要求施工用前对沙的含泥量、氯离子含量、水泥性能等检验复检合格。', '砌筑工程', '简化工序', '7.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (45, '实名制工序', '7.砌体工程（砌块）', '外墙和卫生间的砼坎台符合要求，两防深化图审批手续完成', '砌筑工程', '简化工序', '7.2');
INSERT INTO `tb_inspectaccept_procedure` VALUES (46, '实名制工序', '7.砌体工程（砌块）', '导墙高度、墙体材料种类以及墙体轴线、砂浆强度符合设计要求（严禁使用超时、加水砂浆），拉结筋位置准确', '砌筑工程', '简化工序', '7.3');
INSERT INTO `tb_inspectaccept_procedure` VALUES (47, '实名制工序', '7.砌体工程（砌块）', '门窗洞口的宽度、高度尺寸、窗台压顶是否符合设计要求；是否按照排版图施工；外墙砌体灰缝饱满、勾缝均匀。', '砌筑工程', '简化工序', '7.4');
INSERT INTO `tb_inspectaccept_procedure` VALUES (50, '实名制工序', '7.砌体工程（砌块）', '砌体严禁一次到顶，留置7天；', '砌筑工程', '简化工序', '7.5');
INSERT INTO `tb_inspectaccept_procedure` VALUES (52, '实名制工序', '8.门窗边填塞', '门、窗框缠绕保护膜拆除', '砌筑工程', '简化工序', '8.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (53, '实名制工序', '8.门窗边填塞', '门、窗框周边砂浆填塞饱满、不得用杂物或砖块填塞（包括遗留木块或砖），填塞砂浆不得使用海砂；填塞发泡剂施打连续、饱满、回缝，不得切割', '砌筑工程', '简化工序', '8.2');
INSERT INTO `tb_inspectaccept_procedure` VALUES (54, '实名制工序', '8.门窗边填塞', '遗留固定门窗用的木块、砖石等杂物', '砌筑工程', '简化工序', '8.2');
INSERT INTO `tb_inspectaccept_procedure` VALUES (55, '实名制工序', '8.门窗边填塞', '门、窗洞口过宽或过窄需按要求进行处理', '砌筑工程', '简化工序', '8.3');
INSERT INTO `tb_inspectaccept_procedure` VALUES (57, '实名制工序', '10.外墙基层', '基层应先将螺杆孔眼和洞口填塞密实，拉毛质量符合要求；严格按设计要求满挂钢丝网分层抹灰。', '抹灰工程', '标准工序', '10.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (58, '实名制工序', '10.外墙基层', '砂浆严格按配合比，严禁添加未经公司允许的违规添加剂，不得使用未熟透的石灰膏，不得使用超时，加水砂浆。', '抹灰工程', '标准工序', '10.2');
INSERT INTO `tb_inspectaccept_procedure` VALUES (59, '实名制工序', '10.外墙基层', '抹灰厚度超35mm部位加强处理；抹灰成型阴阳角顺直，墙面平整，强度符合设计要求。', '抹灰工程', '标准工序', '10.3');
INSERT INTO `tb_inspectaccept_procedure` VALUES (60, '实名制工序', '10.外墙基层', '保温材料是否检测且性能满足设计要求，保温板安装是否牢固，保温、防水等做法是否按图施工', '抹灰工程', '标准工序', '10.4');
INSERT INTO `tb_inspectaccept_procedure` VALUES (61, '实名制工序', '10.外墙基层', '线条成型是否顺直、弧度是否顺滑；EPS类轻质泡沫材料是否按设计要求使用，是否更改或应用于可能受力的部位（如首层窗台、挂设物体、易踩踏部位等）', '抹灰工程', '标准工序', '10.5');
INSERT INTO `tb_inspectaccept_procedure` VALUES (62, '实名制工序', '25.外墙面层', '外墙粘贴前必须检查基层，基层强度达标；执行外墙饰面基层验收和外架拆除令验收。并且进行外墙淋水试验合格。', '抹灰工程', '标准工序', '25.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (63, '实名制工序', '25.外墙面层', '粘接和勾缝材料符合要求；面砖粘接牢固、分格符合设计要求；墙面平整，阴阳角和线条顺直；灰缝饱满横平竖直。严禁采用白水泥铺贴外墙砖，不得出现外墙砖脱落现象。', '抹灰工程', '标准工序', '25.2');
INSERT INTO `tb_inspectaccept_procedure` VALUES (64, '实名制工序', '25.外墙面层', '外墙阴阳角和线条顺直，分格灰缝横平竖直，墙面平整、无明显色差,严禁出现可视面观感差现象。', '抹灰工程', '标准工序', '25.3');
INSERT INTO `tb_inspectaccept_procedure` VALUES (65, '实名制工序', '25.外墙面层', '栏杆等安装构件不存在安装不牢、收口差、污染、损坏等影响观感的质量问题。', '抹灰工程', '标准工序', '25.5');
INSERT INTO `tb_inspectaccept_procedure` VALUES (66, '实名制工序', '25.外墙面层', '保温层阴阳角平直度、墙面平整度符合规范要求；飘窗、线条位置等位置的坡度和滴水线合格', '抹灰工程', '标准工序', '25.4');
INSERT INTO `tb_inspectaccept_procedure` VALUES (67, '实名制工序', '24.蓄淋水试验', '所有户型', '混凝土结构工程', '简化工序', '24.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (68, '实名制工序', '12.室内装修工程（饰面砖）', '基层清理合格', '墙面饰面砖||木地板安装||地面饰面砖', '简化工序', '12.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (69, '实名制工序', '12.室内装修工程（饰面砖）', '土建移交精装手续齐全，实测实量交接验收；水电管线、防雷装置等安装已完成，不影响铺贴', '墙面饰面砖||木地板安装||地面饰面砖', '简化工序', '12.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (71, '实名制工序', '12.室内装修工程（饰面砖）', '砖石水泥砂浆涂料等装饰装修材料符合设计要求，地方要求送检需检测合格；粘结材料应符合设计要求', '墙面饰面砖||木地板安装||地面饰面砖', '简化工序', '12.2');
INSERT INTO `tb_inspectaccept_procedure` VALUES (72, '实名制工序', '12.室内装修工程（饰面砖）', '墙地砖铺贴平整，回缝、缝隙均匀，粘结饱满、无空鼓；大面施工无毛糙、观感差现象，特别是拼花图案符合设计要求；地漏位置处理应满足使用功能和设计要求；门槛石、挡水石位置必须湿铺。', '墙面饰面砖||木地板安装||地面饰面砖', '简化工序', '12.3');
INSERT INTO `tb_inspectaccept_procedure` VALUES (74, '实名制工序', '12.室内装修工程（饰面砖）', '空裂预防措施：抹灰砂浆强度达标，砌体顶砖严禁一次到顶，不同材料交接部位挂网合格，管线部位不得出现明显填塞不密实即抹灰隐蔽现象   ', '墙面饰面砖||木地板安装||地面饰面砖', '简化工序', '12.5');
INSERT INTO `tb_inspectaccept_procedure` VALUES (75, '实名制工序', '12.室内装修工程（饰面砖）', '阳露台、厨卫地面排水坡度是否符合要求，室内完成面标高是否符合要求；成品保护措施到位。', '墙面饰面砖||木地板安装||地面饰面砖', '简化工序', '12.4');
INSERT INTO `tb_inspectaccept_procedure` VALUES (76, '实名制工序', '12.室内装修工程（饰面砖）', '木地板材料合格；安装无起拱、与墙周边缝隙紧密', '墙面饰面砖||木地板安装||地面饰面砖', '简化工序', '12.8');
INSERT INTO `tb_inspectaccept_procedure` VALUES (77, '实名制工序', '9.内抹灰工程', '阴阳角顺直；墙面平整', '抹灰工程', '简化工序', '9.4');
INSERT INTO `tb_inspectaccept_procedure` VALUES (78, '实名制工序', '9.内抹灰工程', '超厚部位加强处理，不同材质交接处挂网，抹灰压浆收面无明显抹痕', '抹灰工程', '简化工序', '9.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (79, '实名制工序', '9.内抹灰工程', '油漆无色差、无透底', '抹灰工程', '简化工序', '9.5');
INSERT INTO `tb_inspectaccept_procedure` VALUES (80, '实名制工序', '26.室内装修工程（涂饰）', '天花石膏线顺直、吊顶或抹灰无开裂现象；油漆无色差、无透底；阴阳角顺直；墙面平整；无通长开裂情况。', '墙面涂饰面', '简化工序', '26.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (81, '实名制工序', '26.室内装修工程（涂饰）', '成品保护到位，无较大损坏', '墙面涂饰面', '简化工序', '26.2');
INSERT INTO `tb_inspectaccept_procedure` VALUES (82, '实名制工序', '26.室内装修工程（涂饰）', '装修材料：放射性和甲醛等有害物质超标的、防火性能、配合比不符合要求的、过期和劣质的材料不得用于施工', '墙面涂饰面', '简化工序', '26.3');
INSERT INTO `tb_inspectaccept_procedure` VALUES (83, '实名制工序', '4.铝模工程', '放线定位检查，定位筋按线焊接，铝模根部标高检查', '混凝土结构工程', '标准工序', '4.1');
