INSERT INTO `tb_inspectaccept_procedure` VALUES (85, '实名制工序', '4.铝模工程', '立杆支撑安装到位，受力，有无松动现象，背楞安装规范，销钉销片间距合格，斜撑加固稳固，根部受力，外挑板阳台支撑稳固，拼装缝隙过大，板面拼装平整', '混凝土结构工程', '标准工序', '4.3');
INSERT INTO `tb_inspectaccept_procedure` VALUES (86, '实名制工序', '4.铝模工程', '按照300控制线调整垂直度，平整度，螺杆有无松动，螺帽加固有无松动，梁底飘窗位置螺杆完善', '混凝土结构工程', '标准工序', '4.4');
INSERT INTO `tb_inspectaccept_procedure` VALUES (87, '实名制工序', '4.铝模工程', '按照水平标高调整天花平整度', '混凝土结构工程', '标准工序', '4.5');
