INSERT INTO `tb_inspectaccept_procedure` VALUES (95, '工序交接', '16.防水联合验收', '防水材料质量（品牌、品种、厚度）按要求见证取样送检并检测合格；假冒伪劣、非甲指品牌防水材料。', '混凝土结构工程', '标准工序', '16.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (96, '工序交接', '16.防水联合验收', '卷材铺贴平整，搭接质量合格，无空鼓、皱褶或脱落', '混凝土结构工程', '标准工序', '16.2');
INSERT INTO `tb_inspectaccept_procedure` VALUES (97, '工序交接', '16.防水联合验收', '阴角根部柔性防水按要求上翻，上翻高度足够，同时收口符合设计要求', '混凝土结构工程', '标准工序', '16.3');
INSERT INTO `tb_inspectaccept_procedure` VALUES (98, '工序交接', '16.防水联合验收', '防水被严重破坏未做修补', '混凝土结构工程', '标准工序', '16.4');
INSERT INTO `tb_inspectaccept_procedure` VALUES (99, '工序交接', '16.防水联合验收', '严禁出现防水漏做的情况', '混凝土结构工程', '标准工序', '16.5');
INSERT INTO `tb_inspectaccept_procedure` VALUES (100, '工序交接', '17.后浇带封闭验收', '表面凿毛露骨、清理冲水干净、钢筋和止水措施到位', '混凝土结构工程', '简化工序', '17.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (102, '工序交接', '22.工序移交：砌体→抹灰', '拉毛均匀、毛刺、不超厚，灰饼开间、进深、方正度、抹灰厚度符合要求', '砌筑工程', '简化工序', '22.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (103, '工序交接', '21.工序移交：抹灰→精装', '抹灰强度达标；顺直度符合要求(线条、梁底、阴阳角、天花等)；地面标高正确、无空鼓；墙面平整；房间实测实量合格；细部收口无毛糙感', '抹灰工程', '简化工序', '21.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (104, '工序交接', '18.工序移交：土建→防水', '结构蓄水不漏水，基层无严重孔洞、松散、开裂渗漏等缺陷，细部处理正确', '混凝土结构工程', '简化工序', '18.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (105, '工序交接', '19.工序移交：防水→土建', '防水层蓄水不漏水，材料、厚度、位置、细部处理正确，成品保护规范', '混凝土结构工程', '简化工序', '19.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (106, '工序交接', '20.工序移交：管道安装→沉箱盖板', '防水验收合格不漏水，管道安装正确不漏水，沉箱底部清理干净，底部排水畅通不积水', '混凝土结构工程', '简化工序', '20.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (107, '工序交接', '23.饰面基层验收', '线条横平竖直无错误，大面光滑、洁净、平整、分界清晰', '墙面涂饰面||墙面饰面砖||木地板安装||地面饰面砖', '简化工序', '23.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (108, '工序交接', '14.外墙“拆架令”', '线条平直顺滑美，饰面美观不脱落，面平色匀无污染', '混凝土结构工程', '标准工序', '14.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (109, '工序交接', '16.防水联合验收', '基层处理毛糙（杜绝基层垃圾、裂缝、渗漏、质量缺陷等不作处理）', '混凝土结构工程', '标准工序', '16.4');
INSERT INTO `tb_inspectaccept_procedure` VALUES (110, '实名制工序', '1.地基基础工程（地基与基础安全可靠）', '基础降水、锚杆施工和基础后浇带严格按设计和施工方案；管桩（抗拔桩）桩芯严禁出现锚固不足和桩芯砼同基础一起浇筑；基础后浇带不得在未完成顶板回填土且无有效降水措施的情况下封闭。', '混凝土结构工程', '标准工序', '1.14');
INSERT INTO `tb_inspectaccept_procedure` VALUES (111, '实名制工序', '5.混凝土工程', '现场坍落度测定、离析情况是否符合要求，杜绝出现私自加水情况。', '混凝土结构工程', '简化工序', '5.2');
INSERT INTO `tb_inspectaccept_procedure` VALUES (112, '实名制工序', '11.屋楼地面工程', '基层杂物清理干净；各类材料（保温）送检性能合格。地面管线已安装完成，工序移交完成。  ', '屋楼地面工程', '标准工序', '11.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (113, '实名制工序', '11.屋楼地面工程', '砂浆或砼强度合格；标高、坡度、平整度等指标符合设计要求；表面无裂缝、空鼓。', '屋楼地面工程', '标准工序', '11.2');
INSERT INTO `tb_inspectaccept_procedure` VALUES (114, '实名制工序', '11.屋楼地面工程', '斜坡屋面瓦安装牢固（座浆饱满，铜丝挂设可靠）；平屋面排水功能好、分格缝顺直且灌缝质量好。', '屋楼地面工程', '标准工序', '11.3');
INSERT INTO `tb_inspectaccept_procedure` VALUES (115, '实名制工序', '9.内抹灰工程', '挂网与甩浆：不同材料交接部位挂网到位，钢丝网直径不得小于 0.6mm，挂网搭接宽度不少于10cm。墙体甩浆毛刺感密度及强度符合要求', '抹灰工程', '标准工序', '9.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (116, '实名制工序', '9.内抹灰工程', '水泥、砂、石灰膏材料送检检测合格；严禁砂浆总使用掺入砂浆王之类塑化剂材料；抹灰砂浆强度达标', '抹灰工程', '标准工序', '9.2');
INSERT INTO `tb_inspectaccept_procedure` VALUES (117, '实名制工序', '9.内抹灰工程', '墙体管线安装合格且线槽填塞密实；砌体移交抹灰手续齐全', '抹灰工程', '标准工序', '9.3');
INSERT INTO `tb_inspectaccept_procedure` VALUES (118, '实名制工序', '9.内抹灰工程', '抹灰压浆收面无明显抹痕或面层见格不见网；阴阳角顺直，墙面平整、不毛糙、观感好', '抹灰工程', '标准工序', '9.4');
INSERT INTO `tb_inspectaccept_procedure` VALUES (120, '实名制工序', '13.装配式工程', '剪力墙连接钢筋、叠合板桁架筋必须有可靠的定位措施；夹心保温墙板内、外叶板连接件锚固工艺合理；外挂架挂点、吊点等部位构造措施到位', '混凝土结构工程', '简化工序', '13.1');
INSERT INTO `tb_inspectaccept_procedure` VALUES (121, '实名制工序', '13.装配式工程', '每段墙线均可直接从控制线测量；首层总工复核，其余层栋号长复测；构件安装前应复测墙线、支撑标高；应对构件外观、尺寸、预留孔洞进行检查', '混凝土结构工程', '简化工序', '13.2');
INSERT INTO `tb_inspectaccept_procedure` VALUES (122, '实名制工序', '13.装配式工程', '首个构件示吊装、首层示吊装，现场演示交底；', '混凝土结构工程', '简化工序', '13.3');
INSERT INTO `tb_inspectaccept_procedure` VALUES (123, '实名制工序', '13.装配式工程', '非承重墙及非通缝灌浆的剪力墙应满座浆安装，严禁后塞缝；承重墙底缝每个分仓段应预留长度不小于10cm的观察段采用临时封堵，严禁垫泡沫封堵、分仓；连接钢筋复测纠偏、隐蔽验收，严禁割连接钢筋；外墙板构造防水与外挂墙板钢筋锚固符合设计要求', '混凝土结构工程', '简化工序', '13.4');
INSERT INTO `tb_inspectaccept_procedure` VALUES (124, '实名制工序', '13.装配式工程', '悬挑梁与现浇柱交接处的核心箍安装到位；悬挑受力筋位置正确，严控保护层厚度；楼梯缝高大于20mm，必须座浆安装，严禁采用木垫块；施工层楼梯口应设临边防护。', '混凝土结构工程', '简化工序', '13.5');
INSERT INTO `tb_inspectaccept_procedure` VALUES (125, '实名制工序', '13.装配式工程', '吊装阳台和叠合板支撑架体稳定；吊装墙体斜撑安装稳固；安装标高经复测符合设计要求', '混凝土结构工程', '简化工序', '13.6');
INSERT INTO `tb_inspectaccept_procedure` VALUES (119, '实名制工序', '12.室内装修工程（饰面砖）', '装修材料：放射性和甲醛等有害物质超标的、防火性能、配合比不符合要求的、过期和劣质的材料不得用于施工', '|墙面饰面砖||木地板安装||地面饰面砖', '简化工序', '12.5');
INSERT INTO `tb_inspectaccept_procedure` VALUES (126, '实名制工序', '13.装配式工程', '注浆料质量满足要求，注浆饱满；封条拆除预报，注浆后即时评估，拔塞插孔检查。', '混凝土结构工程', '简化工序', '13.7');
