INSERT INTO `tb_quality_summary_table` VALUES (2101, '地基基础质量要点', '桩基工程：偏位严重/清孔不到位/塌孔/缺少桩尖/钢筋绑扎不合格/断桩/收锤缺少验收/接桩焊缝质量不饱满不连续/超灌高度不足，致桩头浮浆/使用挖机破桩头/其他问题（B级）', '3', '重大质量风险管控', 70);
