INSERT INTO `tb_quality_summary_table` VALUES (988, '检测报告', '保温板材与基层的粘结强度的现场拉拔试验；\n', '1', '资料检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (989, '检测报告', '外墙节能构造现场实体检验', '1', '资料检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (990, '施工组织设计', '1、方案内是否体现工程建筑结构概况、材料量、工期、人员配置等规范要求的基本章节和内容;\n2、是否体现本工程的各基本工序的施工方法，有无绿色施工章节;\n3、有无施工各阶段平面布置图和进度表;\n4、施工平面图中的塔吊、电梯、钢筋场材料场、施工道路等布置是否合理等', '10', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (991, '模板施工方案\n（含高支模）', '1、有无列举本工程梁、板、柱的大小，反映各典型部位的支模高度信息;\n2、有无按梁、板大小进行分类支模方法的表述;\n3、有无表述木方或方钢间距、底托钢管型号间距，有无扫地杆、剪刀撑形式间距、基础处理等信息;\n4、是否有各类梁、板、墙柱支模大样图，是否有楼梯、后浇带支模大样，大样图是否合理;\n5、计算书是否与文字表述的大小及支模方式一致进行验算。', '10', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (992, '外脚手架施工方案', '1、是否有搭设参数表：说明各栋楼落地架是几层到几层，悬挑层是在第几层，说明搭设纵横杆间距、搭设基本高度;\n2、各类型搭设方式要有相应计算书;\n3、是否有连墙件、剪刀撑、脚手架基础处理的设置方法;\n4、有无节点的大样图，大样图是否合理;\n各受力构件（锚固环、钢丝绳、工字钢）的规格大小是否满足公司及规范的要求、是否满足计算要求;\n5、计算书设置是否符合要求，各类型搭设形式是否均有分别计算;\n6、有无悬挑钢平面布置图，悬挑钢平面布置图是否满足计算间距，设置是否合理;\n7、错层阳台等特殊部位方案是否悬挑过长，是否有加固和施工措施，\n8、方案中其它悬挑过长的情况应表述加固措施，加固是否合理。\n9、有斜屋面的是否有体现斜屋面位置的脚手架做法。', '10', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (993, '爬升式脚手架施工方案', '1、是否有机位布置图，反映附墙的间距、板跨的长度等信息;\n2、是否有机位大样图，反映螺帽、垫片的数量、螺杆的直径规格，防坠器、顶撑的做法及数量设置等、使用时附墙的道数符合规范要求\n3、防坠器、顶撑应分开设置\n4、是否有分处防护措施、脚手架底部是否桁架构造;\n5、是否有一些特殊部位如凹凸飘板位、阳台位的附墙构造大样图\n6、是否有各受力构件及部位计算书', '10', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (994, '深基坑方案\n（含支护、土方开挖、降水）', '1、是否有支护形式的大样图、平面图、剖面图，是否有反映设计方案中的各类工艺的施工方案的内容\n2、是否有监测方面的内容\n3、是否有安全措施、应急预案\n4、土方开挖要体现开挖深度、基本的支护设计形式、开挖顺序、开挖的标准、安全措施、有无排水措施', '10', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (995, '铝合金模板施工方案', '1、是否经过公司科技设计部审批\n2、是否按要求修改\n3、现场是否按方案实施\n4、是否有专业单位签名盖章', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (996, '卸料平台方案（悬挑、落地）', '1、悬挑中的拉吊钢丝绳不小于16mm、吊环不小于20mm\n2、平台的大小龙骨、面板做法是否经过计算并满足要求\n3、落地平台是否有说明连墙件间距及做法;\n4、是否有说明搭设高度和具体的立杆纵横距、步距、剪刀撑及操作面的做法及限载措施。是否有相应计算书。', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (997, '群塔作业方案', '1、是否各相邻塔吊各部位距离要超过2米\n2、杜绝低位塔吊塔臂范围与相邻塔身有交叉\n3、方案是否有塔吊平面布置图，各项防碰撞措施', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (998, '塔吊基础施工方案', '1、是否有列表体现各塔吊基础的大小尺寸、持力层及承载力、配筋、塔吊基础标高与建筑基础的相对关系，基础形式（天然还是装配还是四桩基础）信息。\n2、基础是否与方案一致。\n3、装配式基础的方案封面要有安装单位的签名盖章', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (999, '塔吊附墙方案', '1、要有塔吊附墙立面图、各塔吊具体附墙的结构的位置图\n2、要注意不得依附在悬挑阳台或悬挑构件上，尽量附着在框剪结构的主节点上\n3、塔吊附墙的间距应符合相应塔吊说明书的要求', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1000, '桩基础施工方案', '1、工程中各类桩基都要有相应的方案，有相关工艺做法流程的描述\n2、符合图纸的设计要求\n3、要有施工的安全措施', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1001, '吊篮施工方案', '1、注意方案封面及报审表要有专业分包单位的签名盖章和总包单位盖章\n2、要注意对吊篮的配重、吊绳、安全绳、防坠装置的设置、计算进行审核\n3、方案内要表述锚固与伸长长度，吊篮做法的大样图、吊篮布置平面图', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1002, '施工电梯或井字架进料平台方案', '1、平台每层是否有不小于3个连墙件\n2、平邑底工字钢不少于3根并有钢丝绳拉吊\n3、平台悬挑钢及卸荷的设置是否满足计算要求\n4、是否一挑过高而没有中段卸荷\n5、是否有立杆间距步距的表述', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1003, '施工电梯（或井架）基础施工方案', '1、应有电梯平面布置图\n列表说明各台电梯基础的大小厚度配筋、持力层情况等信息\n2、要有基础做法大样图、基础与说明书是否一致\n3、持力层是否符合要求，不满足要求的土层是否经过处理，怎么处理及处理后的承载力是否满足应有说明\n4、地下室的支顶是否到位，是否满足计算要求', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1004, '事故应急预案', '1、注意有预案小组及联系电话，各人员各组分工责任是否明确\n2、要有医院电话及路线、\n3、各类事故的应急措施要齐全', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1005, '高压线防护方案', '1、高压线防护不应使用金属或导电材料进行搭设\n2、高压线防护架体应基础牢固、架体有保持稳定的措施\n3、一般架体高宽比不大于3，否则应设置大脚或加固措施', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1006, '临时用电方案、临时用水', '1、变电器的容量、电线的大小规格应由计算确定\n2、尽量每条主线电流量要平衡平均\n3、平面布置要合理。', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1007, '吊装工程施工方案', '1、起吊点、塔吊与作业面的位置关系图\n2、安全专项措施', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1008, '砌体施工方案', '要有一定的针对性，符合项目实际需求，有砌体排版图', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1009, '抹灰施工方案', '要有一定的针对性，符合项目实际需求', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1010, '防水工程', '要有一定的针对性，符合图纸要求', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1011, '质量通病防治措施方案', '要有一定的针对性，符合项目实际需求', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1012, '大体积混凝土施工方案', '温差较大的地区和季节应有有效温控措施，是否表述有效养护措施等', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1013, '高空作业防坠落方案', '要有一定的针对性', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1014, '三宝四口五临边方案', '要有一定的针对性', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1015, '危险源监控方案', '要有一定的针对性，有监控人员', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1016, '屋面方案', '要有一定的针对性，符合图纸要求', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1017, '外墙涂料（贴砖）方案', '要有一定的针对性，符合图纸要求', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1018, '节能施工方案', '要有一定的针对性，符合图纸要求', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1019, '现场防火消防方案', '要有一定的针对性，要有防火设施布置图及火灾疏散路线', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1020, '安全文明施工方案', '要有一定的针对性，与现场安全文明施工大致相符', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1021, '机电工程施工方案', '要有一定的针对性，符合图纸要求', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1022, '精装修施工方案', '要有一定的针对性，符合图纸要求', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1023, '混凝土工程', '要有一定的针对性，符合图纸要求', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1024, '挡土墙施工方案', '要有一定的针对性，符合图纸要求', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1025, '工程质量安全手册', '要有一定的针对性，符合项目要求', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1026, '冬季施工方案', '要有一定的针对性，符合项目要求', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1027, '钢筋笼吊装及转运方案（基础工程）', '要有一定的针对性，符合项目要求', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1028, '结构楼板裂缝防治专项方案', '要有一定的针对性，符合项目要求', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1029, '地下室开裂渗漏处理方案', '要有一定的针对性，符合项目要求', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1030, '临建施工方案', '要有一定的针对性，符合项目要求', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1031, '地下室回顶方案', '要有一定的针对性，符合项目要求', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1032, '地下室回填土施工专项方案', '要有一定的针对性，符合项目要求，要注意包括侧面回填和顶面回填的内容', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2070, '定位放线控制措施', '总工应对现场基础定位点准确性进行复核（C级）', '3', '重大质量风险管控', 70);
INSERT INTO `tb_quality_summary_table` VALUES (2071, '定位放线控制措施', '总工应对现场基础定位点准确性进行复核（B级）', '2', '重大质量风险管控', 70);
INSERT INTO `tb_quality_summary_table` VALUES (1336, '5+5+3质量管控', '对“5+5+3”关键质量问题文件内容进行宣贯学习、交底（效果不佳扣1分）', '1', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1337, '5+5+3质量管控', '项目针对“5+5+3”关键质量问题编制应对措施的策划方案（方案无针对性扣2分）', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1338, '5+5+3质量管控', '现场“5+5+3”关键质量问题管控效果（质量提升、整改效果差、管控缺失扣1分/项）', '4', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1339, '培训交底', '每月不少于一次质量技术培训（包括当季度各月高管会PPT）,各工序施工前专项交底（无交底扣1分，效果不佳扣0.5分）', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1340, '图纸会审（深化）、工艺选型', '组织图纸会审或图纸深化，前期必须做好土建结构及水电点位的图纸优化，包括门垛宽度、窗台高度、插座位置等。装修阶段做好铺贴排版图深化、细部收口做法深化等（图纸会审或图纸深化不到位，扣1分，未对图纸内容及图纸会审成果交底，扣2分。装修铺贴排版图、优化后的水电点位定位图、优化后的室外综合管网布置图要进行审批，1分/项;组织图纸会审要有记录及会议照片，1分。', '4', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1341, '图纸会审（深化）、工艺选型', '落实公司80项优秀工艺选型要求，现场相应部位工序质量差且未选用相关优秀工艺的扣2分；选型后现场未落地（相应部位工序质量差扣1分，相应部位工序质量可控扣0.5分）', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1342, '样板验收', '每道工序施工前，工序样板齐全（有遗漏、有错误，0.5分/项）；施工样板、交楼样板层完成并经验收合格后方可后续相应工序施工（未进行举牌验收，0.5分/项，样板验收表施工、监理单位、甲方未签字，1分/项，新进班组未学习签名，1分/个，未做样板，2分/项）', '8', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1343, '钢筋管控', '进场验收（每批次进场钢筋是否有质量验收）；是否进行举牌验收；提供有监理、施工单位、甲方签字的材料进场验收台账；', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1344, '钢筋管控', '后台管理（是否有钢筋下料单，是否复核；成品或半成品钢筋加工质量是否符合要求）', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1345, '钢筋管控', '钢筋验收（钢筋隐蔽前是否有自检行为），是否进行举牌验收；有监理、施工单位、甲方签字的验收表', '9', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1346, '混凝土管控', '原材抽检（每月一次搅拌站抽检、砼异常时扣1分）', '1', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1347, '混凝土管控', '材料计划（明确设计浇筑部位的混凝土标号、等级）：总工审核图纸，对混凝土标号建立台帐（未设台账扣1分），并交底项目各相关条线。 ', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1348, '混凝土管控', '浇筑令（核对浇筑部位、砼标号，防混浇措施）：浇筑部位错误扣2分；砼标号错误扣2分；无防混浇措施扣1分', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1349, '混凝土管控', '进场验收：无开盘鉴定扣1分；无和易性检查扣1分；现场无试块制作包括同条件养护试件(每五层额外一组自查试件）扣2分；无坍落度检查扣1分；', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1350, '混凝土管控', '材料计划（明确设计浇筑部位的混凝土标号、等级）：总工审核图纸，对混凝土标号建立台帐（未设台账扣1分），并交底项目各相关条线。 ', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1351, '混凝土管控', '跟班旁站：无进行料单信息复核（强度、部位、配比、坍落度、时间等），1分；过程跟进（楼板厚度控制措施不落实，1分；模板加固体系的校核不落实，1分；楼板标高、平整度的不校核，1分）', '4', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1352, '混凝土管控', '强度掌控：养护工作无有效落实（不少于7天）扣1分；没有对所有构件进行全覆盖检测回弹扣1分，没建立台账分析扣1分', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1353, '验收行为', '执行公司实名验收（1.基础工程、2.钢筋工程（第五项有，不重复扣分）、3.模板工程（铝模）、4.混凝土工程、5.防水工程、6.外墙工程、7.砌体工程、8.门窗边填塞、9.蓄淋水试验、10.室内装修工程（铺贴类、其他类）、11.后浇带,未验收或验收不合格进入下道工序，1分/项；未履行举牌验收扣0.5分/项；其中6.外墙工程要执行“两次”验收。所有需要办理场地移交的，必须有四方（移交单位、接收单位、监理单位、甲方项目）书面签字确认，0.5分/项.', '10', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1354, '实测实量', '甲方区域近三月实测实量平均分（8*平均分%）不达标扣3分', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1355, '实测实量', '提升（整改）策划、措施（无具体策划、措施扣1分，提升、整改效果不佳扣1分）', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1356, '实测实量', '实测实量台账管理，实测实量数据上墙及时（拆模后2天）且真实（无台账扣1分，数据造假扣1分）；每栋楼每周未对实测实量的合格率进行统计并公布在显眼位置扣1分', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1357, '日常巡检', '项目经理定期带队检查，形成有效书面函件（整改单、会议记录等），对检查存在的问题跟踪复查、问题闭合到位（无记录扣1分，未发现重大问题或整改未闭合扣1分）', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1358, '日常巡检', '质量管理APP未正常、有效应用（含每日汇报）扣1分；未按工程进度进行录入APP扣1分；未如实录入扣1分', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1359, '日常巡检', '成品砂浆质量验收管控：设计沟通文件及甲方确认文件（未明确材料性能）、材料考察文件（首次使用品牌）、进场材料质量（合格证明文件、材质检查）、现场取样送检报告（首次进场、按批次）、样板制作情况（甲方及监理验收记录）', '4', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1360, '日常巡检', '砂浆后台管理：每日一次对砂浆原材配比进行检查，1分；搅拌现场要求配合比清晰（挂牌标识）并设置台秤计量，严禁违规添加外加剂，1分；砂、水泥、砂浆、石灰等存放方式合理，在规定存放时间内使用，1分：非商品砂浆要求施工现场采取集中搅拌方式（可设立多个砂浆搅拌站），严禁随处搅拌或楼层人工拌和，2分', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1361, '白名单管理', '未建立白名单资料管理台账，资料根据项目进程不完整（如：必要条件的853内容）扣2分；质量维度不满足白名单要求扣2分', '4', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1362, '会议培训', '每半年未进行一次综合培训（质量、技术、资料、方案）扣1分；每月未召开一次质量线条总结及培训会议（可视频）扣3分；每季度少于一次标杆项目学习交流活动扣1分；', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1363, '月度检查', '每月对区域排名后50%项目进行综合质量巡查（含质量、方案、资料、管理行为等）；\n每两个月对所有项目全覆盖并进行排名（可参照总部季度检查表格）', '6', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1364, '月度检查', '督促项目使用质量管理APP，或未跟进各项目APP使用效果', '4', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1365, '月度检查', '收集项目亮点做法并进行分享', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1366, '风险管控', '统筹各项目省级以上政府质安检查', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1367, '风险管控', '对集团预警、公司重大质量问题（红线、高风险项目）、区域落后项目进行驻点、帮扶，规定时限内风险解除或降级', '4', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1368, '风险管控', '黑白名单管理：对白名单申报项目质量维度各项指标进行预控；\n未建立台账（每月更新）扣2分；出现因质量维度导致项目申报不成功扣2分/项目；', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1369, '风险管控', '“5+5+3”质量管控：根据地域特点，制定分公司关键工序质量管控办法和技术指引，督促指导项目做好“5+5+3”工序质量管控；', '4', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1370, '风险管控', '切实执行公司质量巡查制度，并将巡查项情况记录且进行跟踪销项整改。', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1371, '风险管控', '展示区管理：开放前对展示区质量进行风险评估，单个展示区质量检查把关不少于3次', '1', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1372, '风险管控', '对各级检查重大质量问题监督、整改、验收并向总部反馈', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1373, '交楼维修', '交楼管理：每月梳理交楼项目情况，督促项目做好预分户验收工作并对下个月度交楼项目联合验收前10天做好分公司交楼项目全覆盖预评估；对接区域客服及督促项目及时更新交楼管理指标结果（首月总体交付率、首月零缺陷率、首月户均缺陷条数），做好台账。', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1374, '交楼维修', '维修管理：按时报送项目维修月报，跟踪、监督重点项目维修情况（含立项情况）；对接区域客服及督促项目及时更新维修指标结果（90天标准时限维修户关闭率，总体交付率，维修满意度，快修队伍名单等）', '6', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1375, '工序验收', '督促各项目做好实名制验收工作（包括举牌验收），并不定期抽查', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1376, '工序验收', '对项目关键工序、重要节点进行工序前期质量把关。如：地下室拆模后验收（重点查有无重大质量缺陷）、基础定位放线、塔吊基础、防水工程（地下室、屋面、卫生间）、钢筋工程、模板工程、砌体工程、抹灰工程、外立面施工、专家论证类工程等（首次施工一个月内），并在项目巡检记录薄上进行记录', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1377, '工序验收', '突击检查各项目混凝土浇筑作业，每月抽检不少于30%，并对混凝土强度进行抽检', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1378, '四新管理', '严格按照公司导向及要求推进各项目四新应用工作。\n未按公司年度目标要求制定项目四新应用工作推动计划扣1分；四新应用工作未按计划有效开展扣2分；', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1379, '四新管理', '优秀工艺选型：在建项目优秀工艺选型全覆盖、工艺选型达标率100%\n未按公司年度目标要求推动在建项目进行优秀工艺选型扣3分；在建项目优秀工艺落地情况、应用效果评估不理想（每月是否有序开展，是否创新引进四新技术）扣2分；', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1380, '标杆管理', '每月及时上报总部创优项目管理信息台账（标杆、观摩、政府创优、科技成果等）', '1', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1381, '标杆管理', '制定标杆创优计划，及时上报总部', '1', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1382, '标杆管理', '每月对标杆创优项目指导、帮扶不少于一次，阶段性对项目进行经验总结并组织培训', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1383, '标杆管理', '标杆创优计划是否有序进行，是否满足公司年度指标', '10', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1384, '资料管理', '每两月对项目资料进行全覆盖检查', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1385, '资料管理', '每月对项目的送检情况进行梳理，规避各类送检问题', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1386, '资料管理', '跟踪各项目主要分部验收（基础、主体、节能、竣工等）', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1387, '资料管理', '每月及时上报总部报表（信息统计表，项目资料自查表），每季度一次备案统计及新开项目统计', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1388, '方案管理', '对授权范围内方案进行审核、审批，报总部方案提前把关', '4', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1389, '方案管理', '对重大方案现场落实情况进行过程追踪', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1390, '方案管理', '每两个月对项目方案进行全覆盖检查', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1391, '考核管理', '总工考核：每两个月对项目总工进行考核，并报总部备案', '1', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1392, '考核管理', '资料分包考核：每季度对分包资料进行考核，并报部备案', '1', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (1393, '考核管理', '分供方考核：每季度对分供方进行考核，并报总部备案', '1', '质量管理规定动作', 10);
