INSERT INTO `tb_quality_summary_table` VALUES (2043, '危险源监控方案', '要有一定的针对性，有监控人员', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2044, '屋面方案', '要有一定的针对性，符合图纸要求', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2045, '外墙涂料（贴砖）方案', '要有一定的针对性，符合图纸要求', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2046, '节能施工方案', '要有一定的针对性，符合图纸要求', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2047, '现场防火消防方案', '要有一定的针对性，要有防火设施布置图及火灾疏散路线', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2048, '安全文明施工方案', '要有一定的针对性，与现场安全文明施工大致相符', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2049, '机电工程施工方案', '要有一定的针对性，符合图纸要求', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2050, '精装修施工方案', '要有一定的针对性，符合图纸要求', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2051, '混凝土工程', '要有一定的针对性，符合图纸要求', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2052, '挡土墙施工方案', '要有一定的针对性，符合图纸要求', '2', '施工方案检查', 10);
