INSERT INTO `tb_quality_summary_table` VALUES (2058, '临建施工方案', '要有一定的针对性，符合项目要求', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2059, '地下室回顶方案', '要有一定的针对性，符合项目要求', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2060, '地下室回填土施工专项方案', '要有一定的针对性，符合项目要求，要注意包括侧面回填和顶面回填的内容', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2367, '培训交底', '每月不少于一次质量技术培训（包括当季度各月高管会PPT）,各工序施工前专项交底（无交底扣1分，效果不佳扣0.5分）', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2368, '图纸会审（深化）、工艺选型', '组织图纸会审或图纸深化，前期必须做好土建结构及水电点位的图纸优化，包括门垛宽度、窗台高度、插座位置等。装修阶段做好铺贴排版图深化、细部收口做法深化等（图纸会审或图纸深化不到位，扣1分，未对图纸内容及图纸会审成果交底，扣2分。装修铺贴排版图、优化后的水电点位定位图、优化后的室外综合管网布置图要进行审批，1分/项;组织图纸会审要有记录及会议照片，1分。', '4', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2369, '图纸会审（深化）、工艺选型', '落实公司80项优秀工艺选型要求，现场相应部位工序质量差且未选用相关优秀工艺的扣2分；选型后现场未落地（相应部位工序质量差扣1分，相应部位工序质量可控扣0.5分）', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2370, '样板验收', '每道工序施工前，工序样板齐全（有遗漏、有错误，0.5分/项）；施工样板、交楼样板层完成并经验收合格后方可后续相应工序施工（未进行举牌验收，0.5分/项，样板验收表施工、监理单位、甲方未签字，1分/项，新进班组未学习签名，1分/个，未做样板，2分/项）', '8', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2371, '钢筋管控', '进场验收（每批次进场钢筋是否有质量验收）；是否进行举牌验收；提供有监理、施工单位、甲方签字的材料进场验收台账；', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2372, '钢筋管控', '后台管理（是否有钢筋下料单，是否复核；成品或半成品钢筋加工质量是否符合要求）', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2373, '钢筋管控', '钢筋验收（钢筋隐蔽前是否有自检行为），是否进行举牌验收；有监理、施工单位、甲方签字的验收表', '9', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2374, '混凝土管控', '原材抽检（每月一次搅拌站抽检、砼异常时扣1分）', '1', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2375, '混凝土管控', '材料计划（明确设计浇筑部位的混凝土标号、等级）：总工审核图纸，对混凝土标号建立台帐（未设台账扣1分），并交底项目各相关条线。 ', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2376, '混凝土管控', '浇筑令（核对浇筑部位、砼标号，防混浇措施）：浇筑部位错误扣2分；砼标号错误扣2分；无防混浇措施扣1分', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2377, '混凝土管控', '进场验收：无开盘鉴定扣1分；无和易性检查扣1分；现场无试块制作包括同条件养护试件(每五层额外一组自查试件）扣2分；无坍落度检查扣1分；', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2378, '混凝土管控', '材料计划（明确设计浇筑部位的混凝土标号、等级）：总工审核图纸，对混凝土标号建立台帐（未设台账扣1分），并交底项目各相关条线。 ', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2379, '混凝土管控', '跟班旁站：无进行料单信息复核（强度、部位、配比、坍落度、时间等），1分；过程跟进（楼板厚度控制措施不落实，1分；模板加固体系的校核不落实，1分；楼板标高、平整度的不校核，1分）', '4', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2380, '混凝土管控', '强度掌控：养护工作无有效落实（不少于7天）扣1分；没有对所有构件进行全覆盖检测回弹扣1分，没建立台账分析扣1分', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2381, '验收行为', '执行公司实名验收（1.基础工程、2.钢筋工程（第五项有，不重复扣分）、3.模板工程（铝模）、4.混凝土工程、5.防水工程、6.外墙工程、7.砌体工程、8.门窗边填塞、9.蓄淋水试验、10.室内装修工程（铺贴类、其他类）、11.后浇带,未验收或验收不合格进入下道工序，1分/项；未履行举牌验收扣0.5分/项；其中6.外墙工程要执行“两次”验收。所有需要办理场地移交的，必须有四方（移交单位、接收单位、监理单位、甲方项目）书面签字确认，0.5分/项.', '10', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2382, '实测实量', '甲方区域近三月实测实量平均分（8*平均分%）不达标扣3分', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2383, '实测实量', '提升（整改）策划、措施（无具体策划、措施扣1分，提升、整改效果不佳扣1分）', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2384, '实测实量', '实测实量台账管理，实测实量数据上墙及时（拆模后2天）且真实（无台账扣1分，数据造假扣1分）；每栋楼每周未对实测实量的合格率进行统计并公布在显眼位置扣1分', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2385, '日常巡检', '项目经理定期带队检查，形成有效书面函件（整改单、会议记录等），对检查存在的问题跟踪复查、问题闭合到位（无记录扣1分，未发现重大问题或整改未闭合扣1分）', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2386, '日常巡检', '质量管理APP未正常、有效应用（含每日汇报）扣1分；未按工程进度进行录入APP扣1分；未如实录入扣1分', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2387, '日常巡检', '成品砂浆质量验收管控：设计沟通文件及甲方确认文件（未明确材料性能）、材料考察文件（首次使用品牌）、进场材料质量（合格证明文件、材质检查）、现场取样送检报告（首次进场、按批次）、样板制作情况（甲方及监理验收记录）', '4', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2388, '日常巡检', '砂浆后台管理：每日一次对砂浆原材配比进行检查，1分；搅拌现场要求配合比清晰（挂牌标识）并设置台秤计量，严禁违规添加外加剂，1分；砂、水泥、砂浆、石灰等存放方式合理，在规定存放时间内使用，1分：非商品砂浆要求施工现场采取集中搅拌方式（可设立多个砂浆搅拌站），严禁随处搅拌或楼层人工拌和，2分', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2389, '白名单管理', '未建立白名单资料管理台账，资料根据项目进程不完整（如：必要条件的853内容）扣2分；质量维度不满足白名单要求扣2分', '4', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2390, '会议培训', '每半年未进行一次综合培训（质量、技术、资料、方案）扣1分；每月未召开一次质量线条总结及培训会议（可视频）扣3分；每季度少于一次标杆项目学习交流活动扣1分；', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2391, '月度检查', '每月对区域排名后50%项目进行综合质量巡查（含质量、方案、资料、管理行为等）；\n每两个月对所有项目全覆盖并进行排名（可参照总部季度检查表格）', '6', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2392, '月度检查', '督促项目使用质量管理APP，或未跟进各项目APP使用效果', '4', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2393, '月度检查', '收集项目亮点做法并进行分享', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2394, '风险管控', '统筹各项目省级以上政府质安检查', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2395, '风险管控', '对集团预警、公司重大质量问题（红线、高风险项目）、区域落后项目进行驻点、帮扶，规定时限内风险解除或降级', '4', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2396, '风险管控', '黑白名单管理：对白名单申报项目质量维度各项指标进行预控；\n未建立台账（每月更新）扣2分；出现因质量维度导致项目申报不成功扣2分/项目；', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2397, '风险管控', '“5+5+3”质量管控：根据地域特点，制定分公司关键工序质量管控办法和技术指引，督促指导项目做好“5+5+3”工序质量管控；', '4', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2398, '风险管控', '切实执行公司质量巡查制度，并将巡查项情况记录且进行跟踪销项整改。', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2399, '风险管控', '展示区管理：开放前对展示区质量进行风险评估，单个展示区质量检查把关不少于3次', '1', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2400, '风险管控', '对各级检查重大质量问题监督、整改、验收并向总部反馈', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2401, '交楼维修', '交楼管理：每月梳理交楼项目情况，督促项目做好预分户验收工作并对下个月度交楼项目联合验收前10天做好分公司交楼项目全覆盖预评估；对接区域客服及督促项目及时更新交楼管理指标结果（首月总体交付率、首月零缺陷率、首月户均缺陷条数），做好台账。', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2402, '交楼维修', '维修管理：按时报送项目维修月报，跟踪、监督重点项目维修情况（含立项情况）；对接区域客服及督促项目及时更新维修指标结果（90天标准时限维修户关闭率，总体交付率，维修满意度，快修队伍名单等）', '6', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2403, '工序验收', '督促各项目做好实名制验收工作（包括举牌验收），并不定期抽查', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2404, '工序验收', '对项目关键工序、重要节点进行工序前期质量把关。如：地下室拆模后验收（重点查有无重大质量缺陷）、基础定位放线、塔吊基础、防水工程（地下室、屋面、卫生间）、钢筋工程、模板工程、砌体工程、抹灰工程、外立面施工、专家论证类工程等（首次施工一个月内），并在项目巡检记录薄上进行记录', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2405, '工序验收', '突击检查各项目混凝土浇筑作业，每月抽检不少于30%，并对混凝土强度进行抽检', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2406, '四新管理', '严格按照公司导向及要求推进各项目四新应用工作。\n未按公司年度目标要求制定项目四新应用工作推动计划扣1分；四新应用工作未按计划有效开展扣2分；', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2407, '四新管理', '优秀工艺选型：在建项目优秀工艺选型全覆盖、工艺选型达标率100%\n未按公司年度目标要求推动在建项目进行优秀工艺选型扣3分；在建项目优秀工艺落地情况、应用效果评估不理想（每月是否有序开展，是否创新引进四新技术）扣2分；', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2408, '标杆管理', '每月及时上报总部创优项目管理信息台账（标杆、观摩、政府创优、科技成果等）', '1', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2409, '标杆管理', '制定标杆创优计划，及时上报总部', '1', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2410, '标杆管理', '每月对标杆创优项目指导、帮扶不少于一次，阶段性对项目进行经验总结并组织培训', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2411, '标杆管理', '标杆创优计划是否有序进行，是否满足公司年度指标', '10', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2412, '资料管理', '每两月对项目资料进行全覆盖检查', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2413, '资料管理', '每月对项目的送检情况进行梳理，规避各类送检问题', '3', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2414, '资料管理', '跟踪各项目主要分部验收（基础、主体、节能、竣工等）', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2415, '资料管理', '每月及时上报总部报表（信息统计表，项目资料自查表），每季度一次备案统计及新开项目统计', '5', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2416, '方案管理', '对授权范围内方案进行审核、审批，报总部方案提前把关', '4', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2417, '方案管理', '对重大方案现场落实情况进行过程追踪', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2418, '方案管理', '每两个月对项目方案进行全覆盖检查', '2', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2419, '考核管理', '总工考核：每两个月对项目总工进行考核，并报总部备案', '1', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2420, '考核管理', '资料分包考核：每季度对分包资料进行考核，并报部备案', '1', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2421, '考核管理', '分供方考核：每季度对分供方进行考核，并报总部备案', '1', '质量管理规定动作', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2422, '地基与基础', '工程桩工序验收（含施工现场验收原始记录）', '1', '资料检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2423, '地基与基础', '土方开挖、土方回填验收资料（含施工现场验收原始记录）', '1', '资料检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2424, '地基与基础', '基坑支护验收资料资料', '1', '资料检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2425, '地基与基础', '地基处理验收或桩基础（子分部）验收资料', '1', '资料检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2426, '地基与基础', '分部、分项工程验收资料', '1', '资料检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2427, '主体工程', '地下防水工程验收资料（施工现场验收原始记录）', '1', '资料检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2428, '主体工程', '现浇结构模板安装验收资料（含施工现场验收原始记录）', '1', '资料检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2429, '主体工程', '楼板混凝土拆模申请及混凝土工程质量观感验收资料（含施工现场验收原始记录）', '1', '资料检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2430, '主体工程', '钢筋加工、安装及隐蔽验收资料（含施工现场验收原始记录）', '1', '资料检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2431, '主体工程', '混凝土施工质量验收资料（含施工现场验收原始记录）', '1', '资料检查', 10);
