INSERT INTO `tb_quality_summary_table` VALUES (2532, '施工组织设计', '1、方案内是否体现工程建筑结构概况、材料量、工期、人员配置等规范要求的基本章节和内容;\n2、是否体现本工程的各基本工序的施工方法，有无绿色施工章节;\n3、有无施工各阶段平面布置图和进度表;\n4、施工平面图中的塔吊、电梯、钢筋场材料场、施工道路等布置是否合理等', '10', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2533, '模板施工方案\n（含高支模）', '1、有无列举本工程梁、板、柱的大小，反映各典型部位的支模高度信息;\n2、有无按梁、板大小进行分类支模方法的表述;\n3、有无表述木方或方钢间距、底托钢管型号间距，有无扫地杆、剪刀撑形式间距、基础处理等信息;\n4、是否有各类梁、板、墙柱支模大样图，是否有楼梯、后浇带支模大样，大样图是否合理;\n5、计算书是否与文字表述的大小及支模方式一致进行验算。', '10', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2534, '外脚手架施工方案', '1、是否有搭设参数表：说明各栋楼落地架是几层到几层，悬挑层是在第几层，说明搭设纵横杆间距、搭设基本高度;\n2、各类型搭设方式要有相应计算书;\n3、是否有连墙件、剪刀撑、脚手架基础处理的设置方法;\n4、有无节点的大样图，大样图是否合理;\n各受力构件（锚固环、钢丝绳、工字钢）的规格大小是否满足公司及规范的要求、是否满足计算要求;\n5、计算书设置是否符合要求，各类型搭设形式是否均有分别计算;\n6、有无悬挑钢平面布置图，悬挑钢平面布置图是否满足计算间距，设置是否合理;\n7、错层阳台等特殊部位方案是否悬挑过长，是否有加固和施工措施，\n8、方案中其它悬挑过长的情况应表述加固措施，加固是否合理。\n9、有斜屋面的是否有体现斜屋面位置的脚手架做法。', '10', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2535, '爬升式脚手架施工方案', '1、是否有机位布置图，反映附墙的间距、板跨的长度等信息;\n2、是否有机位大样图，反映螺帽、垫片的数量、螺杆的直径规格，防坠器、顶撑的做法及数量设置等、使用时附墙的道数符合规范要求\n3、防坠器、顶撑应分开设置\n4、是否有分处防护措施、脚手架底部是否桁架构造;\n5、是否有一些特殊部位如凹凸飘板位、阳台位的附墙构造大样图\n6、是否有各受力构件及部位计算书', '10', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2536, '深基坑方案\n（含支护、土方开挖、降水）', '1、是否有支护形式的大样图、平面图、剖面图，是否有反映设计方案中的各类工艺的施工方案的内容\n2、是否有监测方面的内容\n3、是否有安全措施、应急预案\n4、土方开挖要体现开挖深度、基本的支护设计形式、开挖顺序、开挖的标准、安全措施、有无排水措施', '10', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2537, '铝合金模板施工方案', '1、是否经过公司科技设计部审批\n2、是否按要求修改\n3、现场是否按方案实施\n4、是否有专业单位签名盖章', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2538, '卸料平台方案（悬挑、落地）', '1、悬挑中的拉吊钢丝绳不小于16mm、吊环不小于20mm\n2、平台的大小龙骨、面板做法是否经过计算并满足要求\n3、落地平台是否有说明连墙件间距及做法;\n4、是否有说明搭设高度和具体的立杆纵横距、步距、剪刀撑及操作面的做法及限载措施。是否有相应计算书。', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2539, '群塔作业方案', '1、是否各相邻塔吊各部位距离要超过2米\n2、杜绝低位塔吊塔臂范围与相邻塔身有交叉\n3、方案是否有塔吊平面布置图，各项防碰撞措施', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2540, '塔吊基础施工方案', '1、是否有列表体现各塔吊基础的大小尺寸、持力层及承载力、配筋、塔吊基础标高与建筑基础的相对关系，基础形式（天然还是装配还是四桩基础）信息。\n2、基础是否与方案一致。\n3、装配式基础的方案封面要有安装单位的签名盖章', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2541, '塔吊附墙方案', '1、要有塔吊附墙立面图、各塔吊具体附墙的结构的位置图\n2、要注意不得依附在悬挑阳台或悬挑构件上，尽量附着在框剪结构的主节点上\n3、塔吊附墙的间距应符合相应塔吊说明书的要求', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2542, '桩基础施工方案', '1、工程中各类桩基都要有相应的方案，有相关工艺做法流程的描述\n2、符合图纸的设计要求\n3、要有施工的安全措施', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2543, '吊篮施工方案', '1、注意方案封面及报审表要有专业分包单位的签名盖章和总包单位盖章\n2、要注意对吊篮的配重、吊绳、安全绳、防坠装置的设置、计算进行审核\n3、方案内要表述锚固与伸长长度，吊篮做法的大样图、吊篮布置平面图', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2544, '施工电梯或井字架进料平台方案', '1、平台每层是否有不小于3个连墙件\n2、平邑底工字钢不少于3根并有钢丝绳拉吊\n3、平台悬挑钢及卸荷的设置是否满足计算要求\n4、是否一挑过高而没有中段卸荷\n5、是否有立杆间距步距的表述', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2545, '施工电梯（或井架）基础施工方案', '1、应有电梯平面布置图\n列表说明各台电梯基础的大小厚度配筋、持力层情况等信息\n2、要有基础做法大样图、基础与说明书是否一致\n3、持力层是否符合要求，不满足要求的土层是否经过处理，怎么处理及处理后的承载力是否满足应有说明\n4、地下室的支顶是否到位，是否满足计算要求', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2546, '事故应急预案', '1、注意有预案小组及联系电话，各人员各组分工责任是否明确\n2、要有医院电话及路线、\n3、各类事故的应急措施要齐全', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2547, '高压线防护方案', '1、高压线防护不应使用金属或导电材料进行搭设\n2、高压线防护架体应基础牢固、架体有保持稳定的措施\n3、一般架体高宽比不大于3，否则应设置大脚或加固措施', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2548, '临时用电方案、临时用水', '1、变电器的容量、电线的大小规格应由计算确定\n2、尽量每条主线电流量要平衡平均\n3、平面布置要合理。', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2549, '吊装工程施工方案', '1、起吊点、塔吊与作业面的位置关系图\n2、安全专项措施', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2550, '砌体施工方案', '要有一定的针对性，符合项目实际需求，有砌体排版图', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2551, '抹灰施工方案', '要有一定的针对性，符合项目实际需求', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2552, '防水工程', '要有一定的针对性，符合图纸要求', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2553, '质量通病防治措施方案', '要有一定的针对性，符合项目实际需求', '5', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2554, '大体积混凝土施工方案', '温差较大的地区和季节应有有效温控措施，是否表述有效养护措施等', '2', '施工方案检查', 10);
