INSERT INTO `tb_quality_summary_table` VALUES (2561, '现场防火消防方案', '要有一定的针对性，要有防火设施布置图及火灾疏散路线', '2', '施工方案检查', 10);
INSERT INTO `tb_quality_summary_table` VALUES (2562, '安全文明施工方案', '要有一定的针对性，与现场安全文明施工大致相符', '2', '施工方案检查', 10);
