INSERT INTO `tb_system_database` VALUES (22, '重大问题', '3、模板工程', '', '模板支撑体系不稳固（支模架立杆间距超过1.2m、顶端自由端长度超过30cm、对拉螺杆间距＞50cm、螺帽明显未拧紧等、超过70cm高梁侧未设对拉螺杆或斜撑板）', '3.2', 1);
INSERT INTO `tb_system_database` VALUES (23, '一般问题', '3、模板工程', '', '内支模架未形成整体受力体系', '3.2', 1);
INSERT INTO `tb_system_database` VALUES (24, '重大问题', '3、模板工程', '', '内支模架与外架相连', '3.2', 1);
INSERT INTO `tb_system_database` VALUES (25, '一般问题', '3、模板工程', '', '层高超过5m，顶部、底部未设水平剪刀撑、内部每隔5~8m未设置竖向剪刀撑', '3.2', 1);
INSERT INTO `tb_system_database` VALUES (26, '一般问题', '3、模板工程', '', '拼缝间隙大于5mm，无封堵措施', '3.2', 1);
